import React, { useState } from 'react';
import styled from 'styled-components'

var Header = styled.header`
    display: flex;
    justify-content: center;
    margin-top: 10em;
    // width: 100%;
`;

var HomeContainer = styled.div`
    display: flex;
    flex-flow: column;
    // justify-content: center;

    width: 60%;

`;

var Header = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        <AdjustHome>
            <HomeContainer>
                <LinkButton to="csv">Csv Generation</LinkButton>
                <LinkButton to="config">Config Generation</LinkButton>
            </HomeContainer>
        </AdjustHome >
    );
}

export { Header };
